// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Dashboard from './components/Dashboard';
import LoginSpotify from './components/LoginSpotify';
import LoginYouTube from './components/LoginYouTube';

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Dashboard />} /> {/* Set Dashboard as Home Page */}
        <Route path="/spotify/login" element={<LoginSpotify />} />
        <Route path="/youtube/login" element={<LoginYouTube />} />
      </Routes>
    </Router>
  );
};

export default App;
